import React from 'react';
import EditPhotoDetails from './EditPhotoDetails.js';
import ViewPhoto from './ViewPhoto.js';
import ViewPhotoMap from './ViewPhotoMap.js';

class PhotoContainer extends React.Component {
			
	constructor(props) {
        super(props);
		
		this.state = {
			photoView: <ViewPhoto photos={this.props.photos} currentPhoto={this.props.currentPhoto} />
		};
		
		if (this.props.viewState == 'edit') {
			this.setState( {photoView: <EditPhotoDetails photos={this.props.photos} currentPhoto={this.props.currentPhoto} updatePhoto={this.props.updatePhoto} />} );
		} else if (this.props.viewState == 'map') {
			this.setState( {photoView: <ViewPhotoMap photos={this.props.photos} currentPhoto={this.props.currentPhoto} />} );
		} else if (this.props.viewState == 'view') {
			this.setState( {photoView: <ViewPhoto photos={this.props.photos} currentPhoto={this.props.currentPhoto} />} );
		}
			
    }
	render() {
		
		return (
			<section className="photoContainer">
				{this.state.photoView}
			</section>
		);
	}
}

export default PhotoContainer;
